import customAxios from "apiRequests/customAxios";
import { fetchAllHealthTopicsUrl } from "apiRequests/constants";

export const fetchAllHealthTopics = async (dispatch, getState) => {
  const healthTopicsData = await customAxios.get(fetchAllHealthTopicsUrl);
};
